import React from 'react';
import lights from './lights.png';
import './Logo.css';

const Logo = () => {
  return (
    <div className='ma4' style={{overflow: 'hidden'}}>
      <div className="br2 shadow-2"  style={{ height: 150, width: 150 }} >
        <div className="pa3">
          <img style={{paddingTop: '5px'}} alt='CS50 lights logo' src={lights} />
          <p>43 53 35 30 20 4C 49 47 48 54 53</p>
        </div>
      </div>
    </div>
  );
}

export default Logo;
